class Solution {

    /**
     * @param Integer[] $nums
     * @return Integer
     */
    function maximumSum($nums) {
        $factorCount = [];
        foreach ($nums as $num) {
            $factors = $this->primeFactors($num);
            $mask = 0;
            foreach ($factors as $factor => $count) {
                if ($count % 2 != 0) {
                    $mask ^= (1 << ($factor % 30));
                }
            }
            if (!isset($factorCount[$mask])) {
                $factorCount[$mask] = 0;
            }
            $factorCount[$mask] = max($factorCount[$mask], $num);
        }

        $maxSum = max($nums);
        foreach ($factorCount as $i => $sumI) {
            foreach ($factorCount as $j => $sumJ) {
                if (($i & $j) == 0) {
                    $maxSum = max($maxSum, $sumI + $sumJ);
                }
            }
        }

        return $maxSum;
    }

    private function primeFactors($n) {
        $factors = [];
        for ($i = 2; $i * $i <= $n; $i++) {
            while ($n % $i == 0) {
                if (!isset($factors[$i])) {
                    $factors[$i] = 0;
                }
                $factors[$i]++;
                $n /= $i;
            }
        }
        if ($n > 1) {
            $factors[$n] = (isset($factors[$n]) ? $factors[$n] + 1 : 1);
        }
        return $factors;
    }
}
